export default function Artwork() {
    return (
        <div className="p-4 text-white">
            <h2 className="text-2xl font-bold">Artwork Section</h2>
            <p>In addition to my musical activities, I’m also very 
                interested in visual art and have been doing a lot 
                of visual artwork myself over the years. This is a 
                selection of my acrylic paintings created between 
                2005-2014. The style is inspired by 60’s OpArt, but 
                my main interest is a musical, “polyphonic” approach, 
                with multiple, simultaneous motives layered on top 
                of each other. Accordingly, I have also been very 
                interested in the direct integration between visuals 
                and sound – which was a key motivation for my work 
                with audio-visual digital projects.</p>
            <iframe 
                width="420" 
                height="345" 
                src="https://www.youtube.com/embed/Ffe-7T6yDhU" 
                //src={"https://www.youtube.com/embed/Ffe-7T6yDhU"} 
                title="Artwork Video"
                //className="block" 
            ></iframe>
        </div>
    );
}
